--

CREATE PROCEDURE gospodarstwo.zlec_zadanie(input_region integer, input_uprawa character varying, input_desc character varying)
    LANGUAGE plpgsql
    AS $$
DECLARE
	liczba_managerow integer;
	numer_managera integer;
	liczba_prac integer;
	iterator varchar(20);
	data date;
BEGIN
-- sprawdzenie, czy mamy wystarczająco dużo wolnych managerów

liczba_managerow = (
	SELECT COUNT(employees.full_name) 
	FROM gospodarstwo.employees
	INNER JOIN gospodarstwo.headquaters on gospodarstwo.headquaters.headquater_id = gospodarstwo.employees.headquarter_id
	INNER JOIN gospodarstwo.regions on gospodarstwo.headquaters.region_id = gospodarstwo.regions.region_id
	WHERE
	position = 'Manager' and regions.region_id = input_region
	);

liczba_prac = (
	SELECT COUNT(number) FROM gospodarstwo.farmlands
	WHERE 
	region_id = input_region AND type_of_crop = input_uprawa
);

if liczba_prac > liczba_managerow then
RAISE EXCEPTION 'Zbyt mala liczba managerow';
end if;

if liczba_prac = 0 then
RAISE EXCEPTION 'Nie ma zadnych prac do wykonania';
end if;

-- iteracja po wszystkich polach
FOR iterator IN
(
	SELECT number FROM gospodarstwo.farmlands
	WHERE 
	region_id = input_region AND type_of_crop = input_uprawa
)
LOOP
	numer_managera = (
	SELECT employee_id 
		FROM gospodarstwo.employees
		WHERE 
		position = 'Manager' and is_busy = false
		LIMIT 1
	);
	-- INSERT DO FIELDWORKS
	data = (SELECT CURRENT_DATE);
	VALUES (iterator, input_region, numer_managera, data, false, input_desc);
	-- SET employee to busy
	UPDATE gospodarstwo.employees
	SET is_busy = true
	WHERE employee_id = numer_managera;

END LOOP;
END;
$$;


ALTER PROCEDURE gospodarstwo.zlec_zadanie(input_region integer, input_uprawa character varying, input_desc character varying) OWNER TO postgres;

