     JOIN gospodarstwo.machine_types ON ((machine_types.machine_type_id = machinery.machine_type_id)))
     JOIN gospodarstwo.headquaters ON ((machinery.headquater_id = headquaters.headquater_id)))
     JOIN gospodarstwo.regions ON ((regions.region_id = headquaters.region_id)))
