--
-- TOC entry 2969 (class 2618 OID 17382)
-- Name: regiony _RETURN; Type: RULE; Schema: gospodarstwo; Owner: postgres
--

CREATE OR REPLACE VIEW gospodarstwo.regiony AS
 SELECT regions.name AS "Nazwa regionu",
    animals.animal_type AS "Typ zwierzęcia",
    count(animals.animal_type) AS "Łączna liczba sztuk"
   FROM (((gospodarstwo.animals
     JOIN gospodarstwo.herds ON ((herds.herd_id = animals.herd_id)))
     JOIN gospodarstwo.headquaters ON ((herds.headquater_id = headquaters.headquater_id)))
     JOIN gospodarstwo.regions ON ((regions.region_id = headquaters.region_id)))
  GROUP BY regions.region_id, animals.animal_type
  ORDER BY regions.name;


